using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Drawing;
using System.IO;
using System.Threading;
using System.Windows;
using System.Windows.Media;
using System.Windows.Media.Imaging;
using System.Windows.Threading;
using Brushes = System.Windows.Media.Brushes;
using Color = System.Windows.Media.Color;

namespace ZeroHex_Reader
{
    /// <summary>
    /// Interaction logic for MainWindow.xaml
    /// </summary>
    public partial class MainWindow : Window
    {
        public MainWindow()
        {
            InitializeComponent();
            grd_Background.ImageSource = Properties.Resources.apr_logo_rgb_red.ConvertBitmapToImageSource();
        }

        private void BtnStart_Click(object sender, RoutedEventArgs e)
        {
            progbar.Visibility = Visibility.Visible;
            btnStart.Visibility = Visibility.Collapsed;

            // Forces rendering
            Thread t = new Thread(() =>
            {
                var reader = new StreamReader(new MemoryStream(Properties.Resources.challenge));
                var ZeroList = new List<string>();

                var offsetAddress = 0x0000;
                var totalNumBytes = Properties.Resources.challenge.Length;
                var numBytesRead = 0;
                var results = "";
                while (numBytesRead != totalNumBytes)
                {
                    var @byte = reader.Read();
                    if (@byte == 0x00)
                    {
                        ZeroList.Add(offsetAddress.ToString("X5"));
                    }
                    else
                    {
                        if (ZeroList.IsNotEmpty())
                        {
                            var newZeroBlock = "0x{0}\t{1}\n";
                            results += string.Format(newZeroBlock, ZeroList[0], ZeroList.Count);
                            //Console.WriteLine(string.Format(newZeroBlock, ZeroList[0], ZeroList.Count));
                        }
                        ZeroList.Clear();
                    }
                    offsetAddress++;
                    progbar.Dispatcher.Invoke(new Action(() => progbar.Value = ((double)numBytesRead++ / totalNumBytes) * 100));
                }
                progbar.Dispatcher.Invoke(new Action(() => progbar.Visibility = Visibility.Collapsed));
                File.WriteAllText("JPW-APR-Challenge-Results.txt", results);
                lblProg.Dispatcher.Invoke(new Action(() => {
                    lblProg.MouseDown += delegate {
                        Process.Start("JPW-APR-Challenge-Results.txt");
                    };
                    lblProg.MouseEnter += delegate
                    {
                        lblProg.Foreground = Brushes.DodgerBlue;
                    };
                    lblProg.MouseLeave += delegate
                    {
                        lblProg.Foreground = new SolidColorBrush(Color.FromArgb(0xFF,0xD1,0xE5,0xF8));
                    };
                    lblProg.Content = "Click here for results!";
                    lblProg.FontSize = 24.0;
                    lblProg.HorizontalAlignment = HorizontalAlignment.Left;
                    lblProg.VerticalAlignment = VerticalAlignment.Top;
                    lblProg.Margin = new Thickness(0.0);
                    lblProg.Visibility = Visibility.Visible;
                }));
            });

            t.Start();
        }
    }

    public static class Extensions
    {
        public static bool IsNotEmpty<T>(this List<T> lBytes) => lBytes.Count > 0;

        /// <remarks>
        /// Helper to display company logo
        /// SO: https://stackoverflow.com/a/37890829/7476183
        /// </remarks>
        public static BitmapImage ConvertBitmapToImageSource(this Bitmap bitmap)
        {
            MemoryStream ms = new MemoryStream();
            bitmap.Save(ms, System.Drawing.Imaging.ImageFormat.Bmp);
            BitmapImage image = new BitmapImage();
            image.BeginInit();
            ms.Seek(0, SeekOrigin.Begin);
            image.StreamSource = ms;
            image.EndInit();

            return image;
        }
    }




























































































































































































































































































































































    
    
